import logo from "./src/images/LOGO.png"


function NavBar() {



    return (
        <div className="navBarContainer">
            <ul className="navBar">
            <div className="logo">LOGO</div>
                <li>Jeu</li>
                <li>Actualités</li>
                <li>Communauté</li>
                <li>Assistance</li>
